:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Edward Marsh and DAVIS, Jane
  JWILLIAMS, Henry Edward and CONNELL, Isabelle Annie
  JWILLIAMS, Henry Carleton and MILLS, Catherine Leslie
  JWILLIAMS, Terence Leslie Carleton and NOLAN, Mary Joyce
  JWILLIAMS, Timothy Nolan and CHAPMAN, Jennifer
  WILLIAMS, Timothy Nolan and CHAPMAN, Jennifer (cont...)
  also have an orange orchard on the flats.
  b1> WILLIAMS, Samuel Timothy
  b 21.04.1972 d 21.06.1992
  Samuel 6. at Gisborne and d. at Christchurch. His schooling commenced at
  Muriwai for the first five years, then he attended Hereworth where he
  represented the school at rugby and tennis. He then studied at Christ's College
  where he loved art, woodwork, sport and skiing, and continued with these
  interests after returning to attend Gisborne Boys' High School. He then went to
  Wellington Polytechnic where he developed his artistic abilities in the fields
  of photography and design. After completing an Outward Bound course, he went to Queenstown
  with the intention of skiing and using his artistic skills for the winter. But tragically, he
  had a skiing accident and died in Christchurch as a result of this. A memorial plaque made
  from elm grown at "Sherwood" has been placed in the All Saints Church at Muritai.
  02> WILLIAMS, Angus Eric
  b 17.05.1974 d 26.06.1978
  Angus b. at Gisborne and spent most of his life in the Home of Compassion in Lower Hutt, where
  he died.
  03> WILLIAMS, James Chapman
  b 30.09.1975
  James b. at Gisborne. He attended Muriwai School then Hereworth School. He
  played rugby, represented the school at tennis and was a prefect. At Christ's
  College, he also skiied and continued on with these sports while at Gisborne
  Boys' High School. He graduated from the University of Otago with a BCom in
  Marketing. During this time he also gained certificates in ski instructing and
  mountain safety at Wanaka. During a Christmas holiday period, he spent three
  months ski instructing in USA. He is now employed by EFFEM Foods in Auckland.
  04> WILLIAMS, Kate
  b 03.02.1979
  Kate b. at Gisborne. She was educated at Gisborne Intermediate and then went on
  to Woodford House at Havelock North. While at home she had success in the
  equestrian circles on her beautiful all round pony, Roma. Kate was head of a
  boarding house in the sixth form and in her last year was head of Tauro sporting
  house. She was also involved in other organisations at school, including the
  sports committee. In 1996-97 she was awarded a sports scholarship for
  representing the school in A tennis, volleyball, netball, basketball and skiing. She obtained
  a B bursary and is now studying towards a BCom in Marketing and Design at the University of
  Otago.
  03> WILLIAMS, John Terence m on 05.04.1973 to MEYER, Helen Frances
  b 07.10.1950
  b 23.09.1952
  John b. at Gisborne and m. at Waimate. Helen, d/o Leslie John Meyer and
  Jessie Katherine Hunter. Address: "Puta Awa" Station, RD 2, Gisborne.
  John was educated at Hereworth School, Christs College and Lincoln College
  (DipVFM) and then farmed at "Puta Awa" (formerly part of "Sherwood") at
  Muriwai. Most of the property was sold in 1998, retaining only the
  homestead and 40ha of land.
  Refer to "Yorkshire & Yonder. Families of Keartons" published by Evagean Publishing in 1995 for
  records of Helen's family.
